webpackJsonp([0xcb0657c9e7ee],{582:function(e,a){e.exports={data:{site:{siteMetadata:{title:"aendrew.com v8",author:"Aendrew Rininsland"}},markdownRemark:{id:"/Users/andrew.rininsland/Projects/OTHER/aendrew.github.io/src/pages/2011-12-09-all-hackney-ward-maps-one-kmz-shapefile/index.md absPath of file >>> MarkdownRemark",html:'<p>As part of a project I’m working on for the <a href="http://hackneycitizen.co.uk">Hackney Citizen</a>, I’m creating a comprehensive map of a lot of different stuff going on in Hackney. One thing that would be particularly useful would be ward boundaries, ultimately comprising the area of the whole borough.</p>\n<p>Much to my surprise, I could not find a single omnibus Hackney ward shapefile anywhere online. Thus I’ve created one, attached to this blog post.</p>\n<div>\n          <div\n            class="gatsby-resp-iframe-wrapper"\n            style="padding-bottom: 82.35294117647058%; position: relative; height: 0; overflow: hidden;margin-bottom: 1.0725rem"\n          >\n            <html><head></head><body><iframe frameborder="0" scrolling="no" marginheight="0" marginwidth="0" src="http://maps.google.com/maps?f=q&amp;source=s_q&amp;hl=en&amp;geocode=&amp;q=http:%2F%2Fwww.aendrew.com%2Ffiles%2Fhackney_wards.kmz&amp;aq=&amp;sll=51.56319,-0.048871&amp;sspn=0.008524,0.02193&amp;vpsrc=0&amp;ie=UTF8&amp;t=m&amp;ll=51.548799,-0.060519&amp;spn=0.05797,0.087984&amp;output=embed" style="\n            position: absolute;\n            top: 0;\n            left: 0;\n            width: 100%;\n            height: 100%;\n          "></iframe><br><small><a href="http://maps.google.com/maps?f=q&amp;source=embed&amp;hl=en&amp;geocode=&amp;q=http:%2F%2Fwww.aendrew.com%2Ffiles%2Fhackney_wards.kmz&amp;aq=&amp;sll=51.56319,-0.048871&amp;sspn=0.008524,0.02193&amp;vpsrc=0&amp;ie=UTF8&amp;t=m&amp;ll=51.548799,-0.060519&amp;spn=0.05797,0.087984" style="color:#0000FF;text-align:left">View Larger Map</a></small></body></html>\n          </div>\n          </div>\n<p><html><head></head><body><strike></strike></body></html>Google Maps tops out at ~12 regions per page, so to get the entire borough you need to <a href="http://aendrew.com/sites/default/files/hackney_wards.kmz">download the full KMZ file</a> and load it into Google Earth. Going to the <a href="http://maps.google.com/maps/ms?msid=215653240665910605934.0004b39e926a519eded0c&#x26;msa=0&#x26;ll=51.546122,-0.060768&#x26;spn=0.068215,0.175438&#x26;iwloc=0004b39e94944f1f3f759">full map</a> gives you pagination, though the effect is still kind of lost. (On that note: boo on Google Maps for not allowing you to set pagination specifics!)<html><head></head><body></body></html> <strong>EDIT:</strong> Apparently supplying a link to a KMZ file in the Google Maps search field gives you all regions. <a href="http://www.ehow.com/how_5780561_use-kmz-file-google-maps.html">Hat-tip to this eHow article…</a></p>\n<p>All boundaries courtesy of <a href="http://mapit.mysociety.org">mapit.mysociety.org</a>; all I really did was save each of their KML files and compile them together as a folder in Google Earth. Nothing too crazy-difficult, but hopefully should save somebody half an hour further down the road.</p>\n<h2><a href="http://aendrew.com/sites/default/files/hackney_wards.kmz">Full Hackney ward boundary KMZ shapefile</a></h2>\n<p>-Æ.</p>',frontmatter:{title:"All Hackney ward maps in one KMZ shapefile",date:"December 09, 2011"}}},pathContext:{path:"content/all-hackney-ward-maps-one-kmz-shapefile"}}}});
